def plot_rHeston_IE_smiles():
    """
    Plots the smiles for the implicit Euler scheme applied to the rough Heston model.
    """
    plt.plot(k_rrHeston, rrHeston_6, 'k-', label='Fourier inversion')
    plt.plot(k_rHeston_IE, rHeston_IE_bouncy, 'b-', label='Implicit Euler - bouncy')
    plt.plot(k_rHeston_IE, rHeston_IE_sticky, 'r-', label='Implicit Euler - sticky')
    plt.plot(k_rrHeston, rHeston_IE_hreset, 'y-', label='Implicit Euler - hyperplane reset')
    plt.plot(k_rrHeston, rHeston_IE_hreflection, 'g-', label='Implicit Euler - hyperplane reflection')
    plt.plot(k_rrHeston, rHeston_IE_splitkernel, 'c-', label='Implicit Euler - split kernel')
    plt.plot(k_rrHeston, rHeston_IE_splitthrow, 'orange', label='Implicit Euler - split throw')
    plt.plot(k_rHeston_IE, rHeston_IE_sticky_lower, 'r--')
    plt.plot(k_rHeston_IE, rHeston_IE_sticky_upper, 'r--')
    plt.legend(loc='upper right')
    plt.xlabel('log-moneyness')
    plt.ylabel('implied volatility')
    plt.show()


